(function defineGlobalFunctions() {
  /** 
   * A set of helper functions
   */
  var teal = window.teal = window.teal|| {};
  var util = teal.util = teal.util || {};
  var speed = teal.speed = teal.speed || {};

  var queueCookieName = &quot;speed_queue&quot;;
  var currentCookieName = &quot;speed_obj&quot;;
  var cookieLifetimeDays = 2;


  util.getCurrentDomain = function(a, b, c) {
      /**
       * Lifted from utag.loader.lh, returns the TLD+1
       */ 
      a = &quot;&quot; + location.hostname;
      b = a.split(&quot;.&quot;);
      c = (/\.co\.|\.com\.|\.org\.|\.edu\.|\.net\.|\.asn\.|\...\.jp$/.test(a)) ? 3 : 2;
      return b.splice(b.length - c, c).join(&quot;.&quot;);
  }

  util.getCookieDomain = function() {
      /**
       * Assumes that we are allowed to write cookies to the TLD+1
       */
      return util.getCurrentDomain();
  };

  util.writeCookie = function (name, value, days, path) {
      var expires = &quot;&quot;;
      days = days || 365;
      path = path || &quot;&quot;;
      if (days) {
      var date = new Date();
      date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
      expires = &quot;; expires=&quot;+date.toGMTString();
      }
      document.cookie = name + &quot;=&quot; + value + expires + &quot;;domain=&quot; + util.getCookieDomain() + &quot;;path=/&quot; + path;
      return true;
  };

  util.readCookie = function(name) {
      var reString = '(?:(?:^|.*;\\s*)' + name + '\\s*\\=\\s*([^;]*).*$)|^.*$';
      var re = new RegExp(reString);
      var cookieValue = document.cookie.replace(re, &quot;$1&quot;);
      if (!cookieValue) return undefined;
      return cookieValue;
  };

  util.eraseCookie = function(name) {
      document.cookie = name + '=deleted;expires=Thu, 01 Jan 1970 00:00:01 GMT;domain=' + util.getCookieDomain() + ';path=/;';
  };

  speed.manageQueue = function(method, el) {
      /**
       * Shouldn't need to be called directly really, but we need a single function to control the 
       * cookie-based queue to ensure that there aren't timing issues with reading/writing async in
       * different places.
       */

      var q = util.readCookie(queueCookieName);
      if (typeof q === &quot;string&quot;) {
          q = JSON.parse(q); // convert to from string to array if found
      } else {
          q = []; // start empty if no previous cookie
      }

      if (method === &quot;push&quot;) {
          q.push(el);
          q = JSON.stringify(q);
          return util.writeCookie(queueCookieName, q, cookieLifetimeDays);
      } else if (method === &quot;pull&quot;) {
          var pulled = q.shift();
          q = JSON.stringify(q);
          util.writeCookie(queueCookieName, q, cookieLifetimeDays);
          return pulled;
      } else {
          return false;
      }

  };


  speed.getFromQueue = function() {
      /** 
       * Expects a call to accept the page speed timing object we pull off the queue.
      */
      return speed.manageQueue(&quot;pull&quot;);;
  };

  speed.addToQueue = function(el) {
      /** 
       * Expects a page speed timing object that it can put to the queue.
       */
     if (typeof el !== &quot;object&quot;) return false;
     return speed.manageQueue(&quot;push&quot;, el);
  };

  speed.processTimingEvent = function(event) {
    /**
     * Add to the current object or push to the queue and start a new one 
     */
    if (typeof event !== &quot;object&quot; || typeof event.path !== &quot;string&quot;) return false;
    var cookie = util.readCookie(currentCookieName);
    if (typeof cookie === &quot;string&quot;) {
        cookie = JSON.parse(cookie); // convert to from string to object if found
    } else {
        cookie = {}; // start empty if no previous cookie
    }
    // push and reset the object if the path has changed since the last timing event seen
    if (event.path !== cookie.path) {
        if (Object.keys(cookie).length &gt; 0) {
            speed.addToQueue(cookie);
        }
        cookie = {};
        cookie.path = event.path;
        cookie.timestamp = event.timestamp;
        cookie[event.key] = event.value;
    } 
    cookie[event.key] = event.value; 
    cookie = JSON.stringify(cookie);
    util.writeCookie(currentCookieName, cookie);
  };

  speed.reformatAndProcessTimingEvent = function(model, message) {
    /**
     * Process events that are pulled out of the dataLayer array by the helper function
     */

